import React from 'react';
import {Routes, Route, Navigate} from 'react-router-dom'
import {authRoutes} from "../routes";

const AppRouter = () => {
    const isAuth = false
    return (
        <Routes>
            {authRoutes.map(({path, Components}) => {
                <Route path={path} component={Components}/>
            })}
        </Routes>
    );
};

export default AppRouter;
